import React from 'react'
import Home from './Home';
import {
  BrowserRouter as Router,
  Link,
  Route,
  Routes,
} from "react-router-dom";

function Pages() {
  return (
    <div>
        <Router>
        <Route path="/" exact component={Home} />
        </Router>
    </div>
  )
}

export default Pages
